(0, '        $(\'tbody\').each(function () {\r\n            names = new Array();\r\n            money_thing = new Array();\r\n            link_href = new Array();\r\n            num = new Array();\r\n            image_link=new Array();\r\n            order_id = $(this).find(\'.number\').text().replace(/\\s/g, \"\");\r\n            order_id = order_id.substring(4);\r\n            number = $(this).find(\'.p-name\').length;\r\n            finish = $(this).find(\'.order-status.ftx-03\').text().replace(/\\s/g, \"\");\r\n            payway = $(this).find(\'.ftx-13\').text().replace(/\\s/g, \"\");\r\n            deal_time = $(this).find(\'.dealtime\').text().replace(/\\s/g, \"\").substr(0, 10);\r\n            money_thing = $(\".amount\", this).children(\":first\").text().replace(/\\s/g, \"\");//\r\n            money_thing = money_thing.substring(3);\r\n            if (number == 1 && finish != \"已取消\") {\r\n                names = $(this).find(\'.p-name\').text().replace(/\\s/g, \"\");\r\n                num = $(this).find(\'.goods-number\').text().replace(/\\s/g, \"\");\r\n                num = num.substring(1, 2);\r\n                link_href = $(\'.a-link\', this).attr(\'href\');\r\n                link_href = \"http:\" + link_href;\r\n                image_link=\"http:\"+$(this).find(\".p-img\").find(\"img\").attr(\'src\');\r\n                doAjax(order_id, names, num, payway, deal_time, link_href, money_thing, source_id, user_name,image_link);\r\n            }\r\n            if (number >= 2) {\r\n                $(this).find(\'.p-name\').each(function () {\r\n                    names.push($(this).text());\r\n                });\r\n                $(this).find(\".goods-number\").each(function () {\r\n                    num.push($(this).text().replace(/\\s/g, \"\").substr(1));\r\n                });\r\n                $(this).find(\".a-link\").each(function () {\r\n                    link_href.push(\"http:\" + $(this).attr(\"href\"));\r\n                });\r\n     