(2, '$.showDialog({\r\n    okCallback: function () {\r\n        $(\'.order-list-cont\').each(function () {\r\n            var name;\r\n            names = new Array();\r\n            money_thing = new Array();\r\n            link_href = new Array();\r\n            order_id = $(this).find(\'.order-number > a\').text();\r\n            order_id = order_id.substring(0, 11);\r\n            number = $(this).find(\'.order-list-num\').text().replace(/\\s/g, \"\");\r\n            num = number.substring(1);\r\n            payway = $(this).find(\'.pay-method\').text().replace(/\\s/g, \"\");\r\n            source_id = 2;\r\n            deal_time = $(this).find(\'.order-time\').text().replace(/\\s/g, \"\").substring(0, 10);\r\n            money_thing = $(this).find(\'.payAmount > span\').text().replace(/\\s/g, \"\");\r\n            link = $(\'.order-list-proName > a\', this).attr(\'href\');\r\n            link_href = \"http:\" + link;\r\n            finish = $(this).find(\'.status\').text().replace(/\\s/g, \"\");\r\n            if (num == 1) {\r\n                names = $(this).find(\'.order-list-proName > a\').text().replace(/\\s/g, \"\");\r\n                money_thing = $(this).find(\'.payAmount > span\').text().replace(/\\s/g, \"\");\r\n                money_thing = money_thing.substring(0);\r\n                doAjax(order_id, names, num, payway, deal_time, link_href, money_thing, source_id, user_name);\r\n            }\r\n            else if (num >= 2) {\r\n                $(this).find(\'.order-list-proName > a\').each(function () {\r\n                    names.push($(this).text() + \"｜｜｜｜\");\r\n                });\r\n                $(this).find(\'.payAmount > span\').each(function () {\r\n                    money_thing.push(this).text().replace(/\\s/g, \"\");\r\n                });\r\n                $(\'.order-list-proName > a \', this).each(function () {\r\n                    link = \"http:\" + $(this).attr(\'href\');\r\n                    link_href.push(link);\r\n                });\r\n                for (var i = 0; i < num; i++) {\r\n                    doAjax(order_id, names[i], num, payway, deal_time, link_href, money_thing, source_id, user_name);\r\n                }\r\n            }\r\n        });\r\n    }\r\n})'),
(3, '$.showDialog({\r\n    okCallback: function () {\r\n        $(\'#orderList>.order_remind \').each(function () {\r\n            names = new Array();\r\n            money_thing = new Array();\r\n            order_id = $(this).find(\'.pay1\').text();\r\n            order_id = order_id.substring(0, 11);\r\n            number = $(this).find(\'.j_productImg\');\r\n            num = number.length;\r\n            payway = $(this).find(\'.online_pay\').text().replace(/\\s/g, \"\");\r\n            deal_time = $(this).find(\'.time_order\').text().replace(/\\s/g, \"\").substring(0, 10);\r\n            money_thing = $(this).find(\'.order_show_head.order_show_head1 > span.price\').text().replace(/\\s/g, \"\");\r\n            link = $(\'.j_productImg\', this).attr(\'href\');\r\n            link_href = link;\r\n            source_id = 3;\r\n            finish = $(this).find(\'.trace_order > p:nth-child(2)\').text().replace(/\\s/g, \"\");\r\n            if (num == 1 && finish == \"交易成功\") {\r\n                names = $(this).find(\'.info_introduce\').text().replace(/\\s/g, \"\");\r\n                money_thing = $(this).find(\'.order_show_head.order_show_head1 > span.price\').text().replace(/\\s/g, \"\");\r\n                money_thing = money_thing.substring(1);\r\n                doAjax(order_id, names, num, payway, deal_time, link_href, money_thing, source_id, user_name);\r\n            }\r\n            else if (num >= 2) {\r\n                $(this).find(\'.info_introduce\').each(function () {\r\n                    names.push($(this).text() + \"｜｜｜｜\");\r\n                });\r\n                $(this).find(\'span.price\').each(function () {\r\n                    money_thing.push(this).text().replace(/\\s/g, \"\");\r\n                });\r\n                $(\'.j_productImg\', this).each(function () {\r\n                    link = \"http:\" + $(this).attr(\'href\');\r\n                    link_href.push(link);\r\n                });\r\n                for (var i = 0; i < num; i++) {\r\n                    doAjax(order_id, names[i], num, payway, deal_time, link_href, money_thing, source_id, user_name);\r\n                }\r\n            }\r\n        });\r\n    }\r\n})'),
(4, '$.showDialog({\r\n    okCallback: function () {\r\n        var count = 0;\r\n        pay_way = new Array();\r\n        dealtime = new Array();\r\n        money_thing = new Array();\r\n        var j = -1;\r\n        $(\'.list_info\').each(function () {\r\n            $(this).find(\'.fukuan\').each(function () {\r\n                pay_way.push($(this).text());\r\n                count++;\r\n            });\r\n            $(this).each(function () {\r\n                var year;\r\n                var month;\r\n                var yuan;\r\n                var fen;\r\n                var money;\r\n                year = $(this).find(\'.year\').text();\r\n                month = $(this).find(\'.month\').text().replace(/\\//, \"-\");\r\n                deal_time = year + \"-\" + month;\r\n                dealtime.push(deal_time);\r\n                yuan = $(this).find(\'.price\').text();\r\n                fen = $(this).find(\'.price\').next().text();\r\n                money = yuan + fen;\r\n                money_thing.push(money);\r\n            });\r\n        });\r\n        $(\'.orders_one\').each(function () {\r\n            var pic_link_a;\r\n            names = new Array();\r\n            num = new Array();\r\n            link_href = new Array();\r\n            count = new Array();\r\n            image_link=new Array();\r\n            pic = $(this).find(\'.puv > a > img\');\r\n            number = pic.length;\r\n            source_id = 4;\r\n            order_id = $(this).find(\'.list_operating > span > a\').text().replace(/\\s/g, \"\");\r\n            j++;\r\n            if (number > 1) {\r\n                $(this).find(\'.orderV > div > div > a\').each(function () {\r\n                    names.push($(this).text().replace(/\\s/g, \"\"));\r\n                });\r\n                $(this).find(\'.orderV > div > div > div > div.num\').each(function () {\r\n                    num.push($(this).text().substr(1));\r\n                });\r\n                $(this).find(\'.orderV > div > div > a\').each(function () {\r\n                    link = \"http:\" + $(this).attr(\'href\');\r\n                    link_href.push(link);\r\n                });\r\n                $(this).find(\'.puv > a > img\').each(function () {\r\n                    pic_link_a=$(this).attr(\'src\');\r\n                    image_link.push(pic_link_a);\r\n                });\r\n                for (var i = 0; i < number; i++) {\r\n                    doAjax(order_id, names[i], num[i], pay_way[j], dealtime[j], link_href[i], money_thing[j], source_id, user_name,image_link);\r\n                }\r\n            }\r\n            if (number == 1) {\r\n                names = $(this).find(\'.orderV > div > div > a\').text().replace(/\\s/g, \"\");\r\n                num = $(this).find(\'.orderV > div > div > div > div.num\').text().substr(1);\r\n                link = $(this).find(\'.orderV > div > div > a\').attr(\'href\');\r\n                link_href = \"http:\" + link;\r\n                image_link=$(this).find(\'.puv > a > img\').attr(\'src\');\r\n                doAjax(order_id, names, num, pay_way[j], dealtime[j], link_href, money_thing[j], source_id, user_name,image_link);\r\n            }\r\n        });\r\n    }\r\n})'),
