(13, '$.showDialog({\r\n    okCallback: function () {\r\n        $(\"#app > div > div > div.orders-box.clearfix > div > div.orders-body > div\").each(function () {\r\n            var name;\r\n            names = new Array();\r\n            num = new Array();\r\n            money_thing = new Array();\r\n            names = $(this).find(\".order-info > div > a > p\").text();\r\n            number = $(this).find(\" div.order-info > div > p:last-child\").text().replace(/\\s/g, \"\");\r\n            num = number.substring(3);\r\n            source_id = 13;\r\n            finish = $(this).find(\".order-status\").text();\r\n            price = $(this).find(\".order-price\").text().replace(/\\s/g, \"\");\r\n            money_thing = price.substr(4);\r\n            link_href = $(this).find(\".order-info > div > a\").attr(\"href\");\r\n            order_id = $(this).find(\".order-info > div > a\").attr(\"href\").substring(35, 45);\r\n            if (finish != \"待付款\") {\r\n                doAjax(order_id, names, num, payway, deal_time, link_href, money_thing, source_id, user_name);\r\n            }\r\n        })\r\n    }\r\n})'),
(14, '$.showDialog({\r\n    okCallback: function () {\r\n        $(\'.timeline\').each(function () {\r\n            source_id = 14;\r\n            order_id = $(this).find(\'.ordertimeline-info > p:nth-child(3) > a\').text().replace(/\\s/g, \"\");\r\n            names = $(this).find(\'.ordertimeline-info > h3 > a\').text().replace(/\\s/g, \"\");\r\n            deal_time = $(this).find(\'.ordertimeline-time > p.ordertimeline-title.ng-binding\').text().replace(/\\s/g, \"\");\r\n            money_thing = $(this).find(\'.ordertimeline-amount > h3\').text().replace(/\\s/g, \"\");\r\n            payway = $(this).find(\'.ordertimeline-amount > p\').text().replace(/\\s/g, \"\");\r\n            link = $(this).find(\'.ordertimeline-info > h3 > a\').attr(\'href\');\r\n            link_href = \"https://www.ele.me\" + link;\r\n            num = $(this).find(\'.ordertimeline-info-productnum.ng-binding\').text().replace(/\\s/g, \"\");\r\n            image_link=\"http:\"+$(this).find(\'.ordertimeline-avatar > a > img\').attr(\'ng-src\');\r\n            doAjax(order_id, names, num, payway, deal_time, link_href, money_thing, source_id, user_name,image_link);\r\n        });\r\n    }\r\n})'),
(15, '$.showDialog({\r\n    okCallback: function () {\r\n        $(\".moConBox  .moCon-ord\").each(function () {\r\n            var name;\r\n            num = new Array();\r\n            names = new Array();\r\n            link_href = new Array();\r\n            order_id = $(this).find(\".ord-num-box a\").text().replace(/\\s/g, \"\");\r\n            deal_time = $(this).find(\"span.ord-tim > em\").text().replace(/\\s/g, \"\").substring(0, 10);\r\n            price = $(this).find(\".ord-price\").text();\r\n            money_thing = price.substring(1);\r\n            payway = $(this).find(\" td.tdmoh3 > p:nth-child(2)\").text().replace(/\\s/g, \"\");\r\n            source_id = 15;\r\n            var pic = $(this).find(\".ordPicBox.clearfix  img\");\r\n            number = pic.length;\r\n            finish = $(this).find(\" div.opePending > span\").text();\r\n            if (number >= 2) {\r\n                $(this).find(\".ordPicBox.clearfix  img\").each(function () {\r\n                    names.push($(this).attr(\"title\").replace(/\\s/g, \"\"));\r\n                });\r\n                $(this).find(\"a.proId\").each(function () {\r\n                    link_href.push($(this).attr(\"href\").replace(/\\s/g, \"\"));\r\n                })\r\n                for (var i = 0; i < number; i++) {\r\n                    doAjax(order_id, names[i], 1, payway, deal_time, link_href[i], money_thing, source_id, user_name);\r\n                }\r\n            }\r\n            else {\r\n                names = $(this).find(\".ordPicBox.clearfix  img\").attr(\"title\");\r\n                link_href = $(this).find(\"a.proId\").attr(\"href\").replace(/\\s/g, \"\");\r\n                doAjax(order_id, names, 1, payway, deal_time, link_href, money_thing, source_id, user_name);\r\n            }\r\n        })\r\n    }\r\n})'),
(16, '$.showDialog({\r\n    okCallback: function () {\r\n        $(\"tbody tr\").each(function () {\r\n            names = $(this).find(\".txt h4\").text().replace(/\\s/g, \"\");\r\n            order_id = $(this).find(\".txt h5\").eq(0).text().replace(/\\s/g, \"\").substr(4);\r\n            deal_time = $(this).find(\".t-time\").text().replace(/\\s/g, \"\");\r\n            source_id = 16;\r\n            money_thing = $(this).find(\".t-price\").text().replace(/\\s/g, \"\").substr(1);\r\n            num = $(this).find(\".t-amount\").text().replace(/\\s/g, \"\");\r\n            link_href = \"http://t.dianping.com\" + $(this).find(\".txt a\").attr(\"href\");\r\n            image_link=$(this).find(\'.pic > a > img\').attr(\'src\');\r\n            doAjax(order_id, names, num, pay_way, deal_time, link_href, money_thing, source_id, user_name,image_link);\r\n        });\r\n    }\r\n})'),
(17, '$.showDialog({\r\n    okCallback: function () {\r\n        $(\'.trade-entry\').each(function () {\r\n            var pic_link_a;\r\n            names = new Array();\r\n            num = new Array();\r\n            link_href = new Array();\r\n            money_thing = new Array();\r\n            image_link=new Array();\r\n            order_id = $(this).find(\'.order-entry > div > span:nth-child(1)\').text().substr(5);\r\n            pic = $(this).find(\'.image > img\');\r\n            number = pic.length;\r\n            dealtime = $(this).find(\'.order-entry > div > span:nth-child(2)\').text().substr(5, 10);\r\n            pay_way = 777;\r\n            source_id = 17;\r\n            if (number > 1) {\r\n                $(this).find(\'.c-666\').each(function () {\r\n                    names.push($(this).text());\r\n                });\r\n                $(this).find(\'.ol-b-number\').each(function () {\r\n                    num.push($(this).text().replace(/\\s/g, \"\"));\r\n                });\r\n                $(this).find(\'.title.c-666\').each(function () {\r\n                    link = $(this).attr(\'href\').substring(0, 42);\r\n                    link_href.push(link);\r\n                });\r\n                $(this).find(\'.ol-b-item-price p:first-child\').each(function () {\r\n                    money_thing.push($(this).text());\r\n                });\r\n                $(this).find(\'.image > img\').each(function () {\r\n                    pic_link_a=$(this).attr(\'src\');\r\n                    image_link.push(pic_link_a);\r\n                });\r\n                for (var i = 0; i < number; i++) {\r\n                    doAjax(order_id, names[i], num[i], pay_way, dealtime, link_href[i], money_thing[i], source_id, user_name,image_link);\r\n                }\r\n            }\r\n            if (number == 1) {\r\n                names = $(this).find(\'.c-666\').text();\r\n                num = $(this).find(\'.ol-b-number\').text().replace(/\\s/g, \"\");\r\n                link_href = $(this).find(\'.title.c-666\').attr(\'href\').substring(0, 42);\r\n                money_thing = $(this).find(\'.ol-b-item-price p:first-child\').text();\r\n                image_link=$(this).find(\'.image > img\').attr(\'src\');\r\n                doAjax(order_id, names, num, pay_way, dealtime, link_href, money_thing, source_id, user_name,image_link);\r\n            }\r\n        });\r\n    }\r\n})'),
(18, '$.showDialog({\r\n    okCallback: function () {\r\n        $(\" div.orders-list > div.order-v\").each(function () {\r\n            var name;\r\n            names = new Array();\r\n            num = new Array();\r\n            money_thing = new Array();\r\n            names = $(this).find(\" div.content > div.rest-name.clearfix > a > span\").text();\r\n            num = $(this).find(\" div.brief-intro.j-toggle-content > a > img\").length;\r\n            source_id = 18;\r\n            price = $(this).find(\"span.order-money-num\").text().replace(/\\s/g, \"\");\r\n            money_thing = price.substr(1);\r\n            link = $(this).find(\"a.avatar.fl\").attr(\"href\");\r\n            link_href = \"http://waimai.meituan.com/\" + link;\r\n            deal_time = $(this).find(\" div.content > div.rest-detail > span.order-total\").text().replace(/\\s/g, \"\");\r\n            order_id = $(this).find(\"span.order-id\").text().substring(4);\r\n            doAjax(order_id, names, num, payway, deal_time, link_href, money_thing, source_id, user_name);\r\n        })\r\n    }\r\n})'),
(19, '$.showDialog({\r\n    okCallback: function () {\r\n        $(\" #orderList > li\").each(function () {\r\n            var name;\r\n            var uname;\r\n            uname = $(this).find(\" tbody > tr > td.td_left\").text().replace(/\\s/g, \"\");\r\n            names = $(this).find(\" table > tbody > tr > td:nth-child(1)\").text().replace(/\\s/g, \"\");\r\n            names = names + uname;\r\n            source_id = 19;\r\n            price = $(this).find(\" table > tbody > tr > td:nth-child(5) > span\").text().replace(/\\s/g, \"\");\r\n            money_thing = price.substr(1);\r\n            link = $(this).find(\" table > tbody > tr > td:nth-child(1) > a\").attr(\"href\");\r\n            link_href = link;\r\n            deal_time = $(this).find(\" td:nth-child(4)\").text().replace(/\\s/g, \"\");\r\n            deal_time = deal_time.substring(0, 10);\r\n            order_id = $(this).find(\" span:nth-child(2) > a\").text();\r\n            finish = $(this).find(\".bd p:contains(\'已\')\").text().replace(/\\s/g, \"\");\r\n            doAjax(order_id, names, 1, payway, deal_time, link_href, money_thing, source_id, user_name);\r\n        })\r\n    }\r\n})'),
(20, '$.showDialog({\r\n    okCallback: function () {\r\n        $(\'.mainorder\').each(function () {\r\n            var a;\r\n            var b;\r\n            var c;\r\n            var d;\r\n            var e;\r\n            var f;\r\n            a=$(this).find(\'.column\').text().replace(/\\s/g, \"\");\r\n            b=$(this).find(\'.pic > img\').attr(\'title\');\r\n            c=$(this).find(\'.name > div:nth-child(1) > div > div > span\').text();\r\n            d=$(this).find(\'.name > div:nth-child(2) > div\').text().substr(0,8);\r\n            names=a+\" \"+b+\" \"+c+d;\r\n            e=$(this).find(\'.qunatity\').text().replace(/\\s/g, \"\");\r\n            f=e.split(\'×\');\r\n            num=f[1].substr(0,1);\r\n            link_href=\"nothing\";\r\n            order_id=$(this).find(\'.first > a\').text().replace(/\\s/g, \"\");\r\n            deal_time=$(this).find(\'.name > div:nth-child(1) > div > p\').text().replace(/\\s/g, \"\").substr(0,10);\r\n            pay_way=$(this).find(\'.state\').text().replace(/\\s/g, \"\");\r\n            source_id=20;\r\n            money_thing=$(this).find(\'.price > ul > li\').text().replace(/\\s/g, \"\").substr(1);\r\n            doAjax(order_id,names,num,pay_way,deal_time,link_href,money_thing,source_id,user_name);\r\n        });\r\n    }\r\n})'),
