(50, '$.showDialog({\r\n            okCallback: function () {\r\n            $(\'#maillist > div.listing > div.classData > table > tbody  tr.listrow.lev_low\').each(function () {\r\n                var arr_1 = new Array();\r\n                var arr = new Array();\r\n                theme = $(this).find(\'span.w_subjet_hover\').text();\r\n                addresser=$(this).find(\'.sender\').text();\r\n                var time_1=$(this).find(\'.w_data\').attr(\'title\');\r\n                arr_1 = time_1.split(/[\\u4e00-\\u9fa5]/);\r\n                arr = arr_1.slice(0,3);\r\n                time = arr.join(\"-\");\r\n                time = time + \" \"+arr_1[8];\r\n                email_source =\"新浪邮箱\";\r\n                emailAjax(email_source,addresser,theme,time, user_name);\r\n            })\r\n            }\r\n        })'),
(51, '$.showDialog({\r\n            okCallback: function () {    \r\n                $(\"div .rF0\").each(function () {\r\n                    var arr = new Array();\r\n                    var arr1 = new Array();\r\n                    email_source = \"163网易邮箱\";\r\n                    addresser = $(this).find(\".nui-user.ci0\").text();\r\n                    theme = $(this).find(\"span.da0\").text();\r\n                    time = $(this).find(\"div.eO0\").attr(\"title\").replace(/\\s/g,\"\");\r\n                    arr = time.split(/[\\u4e00-\\u9fa5]/);\r\n                    arr1 = arr.slice(0,3);\r\n                    time = arr1.join(\"-\");\r\n                    time = time + \" \"+arr[3];\r\n                    time = time.replace(\'(\' , \"\");\r\n                    emailAjax(email_source,addresser,theme,time, user_name);\r\n                })\r\n            }\r\n        })');
INSERT INTO `qw_website_rule` (`id`, `rule`) VALUES
(100, ' //京东\r\n    var jd=$(\'#ttbar-home\').text().substr(1);\r\n    var source_id=0;            //京东 source_id\r\n    if(jd==\"京东首页\") {\r\n        //获取京东账户的id\r\n        var jdname = $(\"#ttbar-login > div.dt.cw-icon > a\").text();\r\n        //判断绑定\r\n        var judgebound=judgeBound(jdname,source_id);\r\n        if(judgebound.state==\'success\')\r\n        {\r\n            user_name=judgebound.user;\r\n            eval(getRule(source_id));\r\n        }\r\n        else if(judgebound.state==\'error\')\r\n        {\r\n            //判断是否不再提醒,如果不再提醒那不触发任何东西\r\n            var judgeremind=judgeRemind(jdname,source_id);\r\n            if(judgeremind.state==\'error\')\r\n            {\r\n                //弹框进行绑定\r\n                $.showDialog({\r\n                    bundCallback: function () {\r\n                        var username = document.getElementById(\"user\").value;\r\n                        var password = document.getElementById(\"pass\").value;\r\n                        ////判断用户名密码是否正确\r\n                        var judgeuser = judgeUser(username, password);\r\n                        $(\"#whole\").fadeOut();\r\n                        if (judgeuser.state == \'success\') {\r\n                            //绑定成功\r\n                            //弹框绑定成功\r\n                            $.showBoundSuccess({\r\n                                okCallback:function () {\r\n                                    $(\"#whole\").fadeOut();\r\n                                     window.location.reload();\r\n\r\n                                }\r\n                            });\r\n                            bound(judgeuser.uid, jdname, source_id);\r\n                            user_name = username;\r\n                            eval(getRule(source_id));\r\n                        }\r\n                        else {\r\n                            //弹框用户名会密码错误绑定失败\r\n                            $.showBoundFail({\r\n                                okCallback: function () {\r\n                                    $(\"#whole\").fadeOut();\r\n                                    // $.showDialog();\r\n                                    window.location.reload();\r\n                                }\r\n                            })\r\n                            //返回之前的弹框\r\n                        }\r\n                    },\r\n                    cancleCallback:function() {\r\n                        // var a = $(\"input[type=\'checkbox\']\").is(\':checked\');\r\n                        if($(\"input[type=\'checkbox\']\").is(\':checked\')){\r\n                            setRemind(jdname,source_id);\r\n                            $(\"#whole\").fadeOut();\r\n                        }\r\n                        else{\r\n                            $(\"#whole\").fadeOut();\r\n                        }\r\n                    },\r\n                    regCallback:function(){\r\n                        $(\"#whole\").fadeOut();\r\n                        window.open(\"http://www.dataman.top/sphider/index.php/Qwadmin/login/index.html\");\r\n                    }\r\n            })\r\n        }\r\n    }\r\n}\r\n\r\n\r\n//淘宝\r\n    var tb=$(\".mt-tblogo\").attr(\'title\');\r\n    if(tb==\"我的淘宝\")\r\n    {\r\n        eval(getRule(1));\r\n    }\r\n\r\n//当当网\r\n    var dd=$(\"#J_myhomeBtn\").text().substr(0);\r\n    if(dd==\"我的当当\") {\r\n        eval(getRule(2));\r\n    }\r\n\r\n\r\n//唯品会\r\n    var vip=$(\".hd-logo-nav\").text().replace(/\\s/g, \"\").substr(0,5);\r\n    if(vip==\"我的唯品会\")\r\n    {\r\n        eval(getRule(3));\r\n    }\r\n\r\n//中粮我买网\r\n    var zl = $(\'#mem_right\').contents().find(\'#tabDiv > ul > li:nth-child(1) > div\').text();\r\n    if(zl == \"全部订单\"){\r\n        eval(getRule(4));\r\n    }\r\n\r\n//国美电器\r\n    var gm=$(\'#gome-entry-link>a\').text().substr(0);\r\n    if(gm==\"国美首页\") {\r\n        eval(getRule(5));\r\n    }\r\n\r\n//网易考拉\r\n    var kaola=$(\".logokaola\").attr(\"title\");\r\n    if(kaola==\"网易考拉海购\")\r\n    {\r\n        eval(getRule(6));\r\n    }\r\n\r\n//亚马逊\r\n    var ymx = $(\'h1.a-spacing-medium\').text().replace(/\\s/g,\"\");\r\n    if(ymx == \"我的订单\"){\r\n        eval(getRule(7));\r\n    }\r\n\r\n//1号店\r\n    var yhd=$(\".hd_topbar_home\").text().replace(/\\s/g, \"\").substr(1);\r\n    if(yhd==\"1号店首页\"){\r\n        eval(getRule(8));\r\n    }\r\n\r\n//美丽说\r\n    var mls=$(\".go-home\").text().replace(/\\s/g, \"\");\r\n    if(mls==\"美丽说首页\"){\r\n        eval(getRule(9));\r\n    }\r\n\r\n//蘑菇街\r\n    var mg = $(\"#navListWrap .mu_nav.mu_expand > div\").text().replace(/\\s/g,\"\");\r\n    if(mg == \"我的订单\"){\r\n        eval(getRule(10));\r\n    }\r\n\r\n//凡客诚品\r\n    var vancl=$(\"#position\").text().replace(/\\s/g, \"\").substr(7,4);\r\n    if(vancl==\"凡客首页\")\r\n    {\r\n        eval(getRule(11));\r\n    }\r\n\r\n//顺丰优选\r\n    var sfbest=$(\".logoright\").attr(\"title\");\r\n    if(sfbest==\"顺丰优选\")\r\n    {\r\n        eval(getRule(12));\r\n    }\r\n\r\n//美团\r\n    var mt = $(\".header-title-module > div > a > img\").attr(\"alt\");\r\n    if(mt == \"美团\"){\r\n        eval(getRule(13));\r\n    }\r\n\r\n//饿了么\r\n    var elm=$(\".topbar-logo\").text();\r\n    if(elm==\"饿了么\"){\r\n        eval(getRule(14));\r\n    }\r\n\r\n//酒仙网\r\n    var jx = $(\" div.uBread > a:nth-child(1) > b\").text();\r\n    if(jx==\"我的酒仙网\"){\r\n        eval(getRule(15));\r\n    }\r\n\r\n//大众点评\r\n    var dianping=$(\".current\").text().replace(/\\s/g, \"\");\r\n    if(dianping==\"团购首页\")\r\n    {\r\n        eval(getRule(16));\r\n    }\r\n\r\n//贝贝网\r\n    var bei=$(\".no-border-top\").text();\r\n    if(bei==\"我的交易\"){\r\n        eval(getRule(17));\r\n    }\r\n\r\n//美团外卖\r\n    var mt = $(\".middle-nav > div > h1 > a > img\").attr(\"alt\");\r\n    if(mt == \"美团外卖\"){\r\n        eval(getRule(18));\r\n    }\r\n\r\n//携程\r\n    $(\"#orderList\").show(function(){\r\n        var xc = $(\"#index > span\").text().replace(/\\s/g,\"\");\r\n        if(xc == \"我的携程首页\"){\r\n            eval(getRule(19));\r\n        }\r\n    })\r\n\r\n//去哪儿\r\n    var qunar=$(\".q_ucsidebar_order > a\").text().replace(/\\s/g, \"\");\r\n    if(qunar==\"我的订单\"){\r\n        eval(getRule(20));\r\n    }\r\n\r\n//途牛旅游\r\n    var tuniu=$(\".item_order\").eq(0).text();\r\n    if(tuniu==\"途牛商旅\")\r\n    {\r\n        eval(getRule(21));\r\n    }\r\n\r\n    //新浪邮箱\r\n    var xinlang = $(\"#maillist > div.listing > div.mail_list_tip.mail_list_viewRead > span.mlRead > a\").text();\r\n    if(xinlang == \"全部设为已读\") {\r\n eval(getRule(50));\r\n    }\r\n\r\n    //163邮箱\r\n    var wy;\r\n    wy = $(\"#_mail_link_6_132\").attr(\'title\').replace(/\\s/g, \"\");\r\n    if(wy == \"全部设置为已读邮件\"){\r\n eval(getRule(51));\r\n    }');
